    false,nt"url": null,nt"notes": "Summary results from NYC Community Health
    Survey 2010-2014: adults ages 18 years and older rnSource: NYC Community Health
    Survey (CHS) 2010-14.rnThe Community Health Survey (CHS) includes self-reported
    data from adults, years 18 and older. CHS has included adults with landline phones
    since 2002 and, starting in 2009, also has included adults who can be reached by
    cell-phone. rnStarting in 2011, CHS weighting methods were updated to use Census
    2010 and additional demographic characteristics (http://www1.nyc.gov/assets/doh/downloads/pdf/epi/epiresearch-chsmethods.pdf
    ). rnrnData are age-adjusted to the US 2000 Standard Population.trnData prepared
    by Bureau of Epidemiology Services, New York City Department of Health and Mental
    HygienernrnThe New York City Community Health Survey (CHS) is a telephone survey
    conducted annually by the DOHMH, Division of Epidemiology, Bureau of Epidemiology
    Services. CHS provides robust data on the health of New Yorkers, including neighborhood,
    borough, and citywide estimates on a broad range of chronic diseases and behavioral
    risk factors. The data are analyzed and disseminated to influence health program
    decisions, and increase the understanding of the relationship between health behavior
